import React from "react";
import Iterm from "./Iterms";
import { Link } from "react-router-dom";

const Product = (props) => {
  return (
    <>
      {props.product.map((product, id) => (
        <>
          <Link to={`/blogs/${details.id}`}>
            <Iterm details={product} key={id} />
          </Link>
        </>
      ))}
    </>
  );
};

export default Product;
